import { useDispatch, useSelector } from 'react-redux';
import { booksSelector, dogetbooksAsync } from './main_shopSlice';



const MainShop = () => {
    const dispatch = useDispatch();
    const booksAr = useSelector(booksSelector).books;
  return (
    <div>
    <button onClick={()=>dispatch(dogetbooksAsync())}>get Data</button>
    {booksAr.map(item=>(
        <div>{item.name}</div>
    ))}
    </div>  
  )
}

export default MainShop
